import React from "react";

const CoreTeamMember = ({ member }) => {
  return (
    <div>
      <img src={member.img} alt="" />
      <p>{member.name}</p>
      <p>{member.post}</p>
      <p>{member.name}</p>
    </div>
  );
};

export default CoreTeamMember;
